import React from "react";
import SHOP_DATA from "./shopData";
import "./shoppage.styles.scss";

class ShopPage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      collections: SHOP_DATA,
    };
  }
  render() {
    return (
      <div>
        <h1>Shop Page</h1>
      </div>
    );
  }
}

export default ShopPage;
